import styles from '../styles/scss/dashboard-menu-item.module.scss';
import Link from 'next/link';
import classnames from 'classnames';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';

const DashboardMenuItem = ({ menuTitle, menuLinkReference, menuIconImgRef }) => {
	return (
		<Link href={menuLinkReference}>
			<div className={styles.menuItemContainer}>
				<div className={styles.menuItemInfo}>
					<div className={styles.iconContainer}>
						<img src={menuIconImgRef} alt={`${menuTitle} Icon`} />
					</div>
					<FontAwesomeIcon icon="check-square" />
					Favorite beverage: <FontAwesomeIcon icon="coffee" />
					<h3 className={styles.menuTitle}>{menuTitle}</h3>
				</div>
				<div className={styles.active} />
			</div>
		</Link>
	);
};

export default DashboardMenuItem;
